import { PreFilledStateService } from "./PreFilledStateService";
export class PrefilledSplitStateService {
    constructor(statePrefill) {
        this.currentIndex = 0;
        this.stateServices = statePrefill.map((record) => new PreFilledStateService(record));
    }
    get(key) {
        return this.stateServices[this.currentIndex].get(key);
    }
    set(key, value) {
        this.stateServices[this.currentIndex].set(key, value);
    }
    changeStateService(index) {
        this.currentIndex = index;
    }
}
